import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import ChartComponent from './ChartComponent';

const StockDetail = () => {
  const { primary_ticker } = useParams();
  const [stockData, setStockData] = useState(null);
  const [tradingViewSymbol, setTradingViewSymbol] = useState('');

  useEffect(() => {
    const tickerWithPeriod = primary_ticker.replace('-', '.');
    fetch(`http://localhost:8000/api/stocks/${tickerWithPeriod}/`)
      .then(response => response.json())
      .then(data => setStockData(data))
      .catch(error => console.error('Error fetching stock data:', error));
  }, [primary_ticker]);

  if (!stockData) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>{stockData.name} HELLO</h1>
      {/* Render more stock details here */}
    </div>
  );
};

export default StockDetail;
